import { usePropertiesQuery } from '../../generated/graphql'
import { Typography, Container} from '@material-ui/core';
import { PropertyView } from './PropertyView';

interface Props {
    selectPropListener: any
    propertyActive: any
}


export const PropertyList:  React.FC<Props> = (Props) => {
    const {data, loading, error} = usePropertiesQuery();


    if(loading){
        return <div>
            loading ....
        </div>
    }

    if(error){
        console.log(error)
        return <div>err</div>
    }

    if(!data){
        return <div>
            no data
        </div>
    }

    return (
        <div>
            <Container>
                <Typography variant="h6">
                    Gartenh√§user
                </Typography>

                    {data.allProperties?.map((x) => (                        

                                <PropertyView property={x} propertySelectedListener={Props.selectPropListener}></PropertyView>

                    ))}

            </Container>
        </div>
    )

}
